import React from "react";
import styles from "./Slider.module.css";

const Slider = props => {
  return (
    <div className={styles.slider}>
      <div className="slider__left"></div>
      <div className="slider__center">
        <div className="slider__center_inner">
          <div className="center_inner__wrapper">
            <div className="center_inner__image"></div>
          </div>
        </div>
      </div>
      <div className="slider__right"></div>
    </div>
  );
};

export default Slider;
